using System.Collections.ObjectModel;
using System.ComponentModel;
using System.Runtime.CompilerServices;
using System.Windows;

namespace PictureBoxDemo
{
    /// <summary>
    /// Interaction logic for MainWindow.xaml
    /// </summary>
    public partial class MainWindow : Window, INotifyPropertyChanged
    {
        public event PropertyChangedEventHandler PropertyChanged;

        public MainWindow()
        {
            this.InitializeComponent();
            WeakEventManager<Window, RoutedEventArgs>.AddHandler(this, "Loaded", this.OnLoaded);

            this.WindowTitel = "PictureBox WPF Demo";

            this.DataContext = this;
        }

        private string _WindowTitel;

        public string WindowTitel
        {
            get { return this._WindowTitel; }
            set
            {
                if (this._WindowTitel != value)
                {
                    this._WindowTitel = value;
                    this.OnPropertyChanged();
                }
            }
        }

        public ObservableCollection<byte[]> Pictures { get; } = new();

        private byte[] _selected;
        public byte[] SelectedPicture
        {
            get => _selected;
            set { _selected = value; OnPropertyChanged(); }
        }

        private string _PictureInfo;

        public string PictureInfo
        {
            get { return this._PictureInfo; }
            set
            {
                if (this._PictureInfo != value)
                {
                    this._PictureInfo = value;
                    this.OnPropertyChanged();
                }
            }
        }

        private void OnLoaded(object sender, RoutedEventArgs e)
        {
            this.Pictures.Add(Base64ToByteArray(DemoBilder.Bild_A));
            this.Pictures.Add(Base64ToByteArray(DemoBilder.Bild_B));
            this.Pictures.Add(Base64ToByteArray(DemoBilder.Bild_C));
            this.Pictures.Add(Base64ToByteArray(DemoBilder.Bild_D));
            this.Pictures.Add(Base64ToByteArray(DemoBilder.Bild_E));

            this.SelectedPicture = this.Pictures[0];

            this.PictureInfo = "~Test";
        }

        private static byte[] Base64ToByteArray(string stringInBase64)
        {
            return System.Convert.FromBase64String(stringInBase64);
        }

        #region INotifyPropertyChanged implementierung
        protected virtual void OnPropertyChanged([CallerMemberName] string propertyName = "")
        {
            PropertyChangedEventHandler handler = this.PropertyChanged;
            if (handler == null)
            {
                return;
            }

            var e = new PropertyChangedEventArgs(propertyName);
            handler(this, e);
        }
        #endregion INotifyPropertyChanged implementierung

        private static class DemoBilder
        {
            static DemoBilder()
            {
                Bild_A = "";
                Bild_B = "";
                Bild_C = "";
                Bild_D = "";
                Bild_E = "";
            }

            public static string Bild_A { get; }
            public static string Bild_B { get; }
            public static string Bild_C { get; }
            public static string Bild_D { get; }
            public static string Bild_E { get; }
        }
    }
}